window.bookSummaryJSON = "<p><b>Evil has tipped the scales in the balance of time. Ember just doesn’t know it yet. </b> </p> <p>Ember Brighton knows exactly what she wants in life, and how to get there, until she finds out her life is intricately woven and laid out...and not in any of the ways she planned. </p> <p>Unbeknownst to Ember, her family has a secret, unique ability to travel through time, and Ember’s about to become part of the mission to stop the evil that threatens them all. </p> <p>Her first adventure leads her right into the arms of Rane Andersson, an unlikely ally. But he’s not who he appears to be, and time is running out to uncover the truth to save her future. </p> <p>With everything she loves at stake, Ember is forced to take matters into her own hands, no matter how dangerous the circumstances turn out to be. </p> <p><i>Fans of the Outlander and A Shade of Vampire series won’t be able to put this epic time travel, paranormal romance down! </i> </p> <p><b>Buy now to travel to a new world, just waiting to consume you! </b></p>"; 
